INSERT INTO `lsjs_ezprint` VALUES (1,'list','列表示例','<p></p><p style=\"text-align: center; \">基本信息</p><table data-type=\"table\" class=\"table table-bordered\" style=\"text-align: center;\"><tbody><tr><td>姓名</td><td><p><a class=\"printVar\" data-field=\"nickname\" href=\"nickname\">{nickname}</a><br></p></td></tr><tr><td>邮箱</td><td><p><a class=\"printVar\" data-field=\"email\" href=\"email\">{email}</a><br></p></td></tr></tbody></table>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<p></p><p></p><table data-type=\"dataSource\" id=\"list\" class=\"table table-bordered\"><tbody><tr><td><p><a class=\"printTableVar\" data-field=\"name\" href=\"name\">[姓名]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"email\" href=\"email\">[邮箱]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"createtime\" href=\"createtime\">[创建时间]</a><br></p></td></tr></tbody></table><p style=\"text-align: center; \"><br></p><p></p>',1591189280,1593147426),(2,'hetong','合同','<p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\"><a class=\"printVar\" data-field=\"company1\" href=\"company1\"><u><b>{company1}</b></u></a>公司（以下简称甲方）为统一和提高<a class=\"printVar\" data-field=\"company2\" href=\"company2\"><font color=\"#000000\" style=\"background-color: rgb(255, 0, 0);\"><u><b>{company2}</b></u></font></a>(以下简称乙方)的店面和产品形象。为乙方营造更好的销售环境，经双方协商，本着自愿、平等、互惠、互利的原则，达成如下协议：</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">自协议签定之日，甲方负责为乙方提供店面整体设计及装修。装修内容包括：</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">门头广告牌的设计、制作、安装;<br>产品形象墙的设计、制作、安装;<br>产品展示架的设计、制作、安装;<br>店内主体色调的制定、粉刷;<br>店内棚顶吊旗的设计、制作、安装;<br>甲方免费为乙方提供样板一套、安装工作服四套及各种证书和产品说明。</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">自协议签订之日起，乙方需向甲方交纳装修保证金人民币<a class=\"printVar\" data-field=\"price\" href=\"price\">{price}</a>元整。</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">乙方在协议签订之日起一年内不得兼营其它品牌或与甲方有冲突的产品，否则将扣除乙方的装修保证金。</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">甲、乙双方合作满一年后，乙方能很好的维护甲方的产品形象，并无违约情况，甲方将如数返还乙方的装修保证金（返款方式以地板兑现）。</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">本协议一式3份，甲方2份，乙方1份。<br>本协议修改由双方协商解决。<br>本协议自双方盖章之日起生效至年月日终止。</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">甲&nbsp;&nbsp;方：&nbsp;&nbsp;&nbsp;<b><a class=\"printVar\" data-field=\"name1\" href=\"name1\">{name1}</a>&nbsp;</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 乙&nbsp;&nbsp;方：<a class=\"printVar\" data-field=\"name2\" href=\"name2\">{name2}</a><br>办公地址：&nbsp;&nbsp;&nbsp;<b><a class=\"printVar\" data-field=\"addr1\" href=\"addr1\">{addr1}</a>&nbsp;</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;办公地址：<a class=\"printVar\" data-field=\"addr2\" href=\"addr2\"><b>{addr2}</b></a><br>开户银行：&nbsp;&nbsp;&nbsp;<b>&nbsp;<a class=\"printVar\" data-field=\"bank1\" href=\"bank1\">{bank1}</a>&nbsp;&nbsp;&nbsp;</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 开户银行：<a class=\"printVar\" data-field=\"bank2\" href=\"bank2\"><b>{bank2}</b></a><br>代表人（签字）：&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 代表人（签字）：<br><br></p>',1592621691,1592665065),(3,'XSD','销售单','<font size=\"4mm\"></font><p style=\"line-height:8px;\"><font size=\"4mm\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<u><a class=\"printVar\" data-field=\"company_name\" href=\"company_name\">{公司名称}</a>销 售 服 务 单</u>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </font><font size=\"2mm\">单号：<a class=\"printVar\" data-field=\"order_code\" href=\"order_code\">{单号}</a></font></p><font size=\"1.9mm\"><p style=\"line-height:0px;\">客户名称：<a class=\"printVar\" data-field=\"order_user_name\" href=\"order_user_name\">{客户名称}</a>&nbsp;&nbsp; 联系人：<a class=\"printVar\" data-field=\"order_user_contact\" href=\"order_user_contact\">{联系人}</a>&nbsp; 联系电话：<a class=\"printVar\" data-field=\"order_user_tel\" href=\"order_user_tel\">{联系电话}</a>&nbsp;地址：<a class=\"printVar\" data-field=\"order_user_address\" href=\"order_user_address\">{地址}</a>&nbsp; 日期：<a class=\"printVar\" data-field=\"order_date\" href=\"order_date\">{日期}</a>&nbsp; &nbsp;预约时间：<a class=\"printVar\" data-field=\"order_service_date\" href=\"order_service_date\">{预约时间}</a></p></font><table style=\"border-color:black\" data-type=\"dataSource\" id=\"list\" class=\"table table-bordered\"><tbody><tr><td><p><a class=\"printTableVar\" data-field=\"iostock_sn\" href=\"iostock_sn\">[序号]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"iostock_product_name\" href=\"iostock_product_name\">[产品名称]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"iostock_product_type\" href=\"iostock_product_type\">[规格]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"iostock_unit\" href=\"iostock_unit\">[单位]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"iostock_outnumber\" href=\"iostock_outnumber\">[数量]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"iostock_price\" href=\"iostock_price\">[单价]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"iostock_amount\" href=\"iostock_amount\">[金额]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"iostock_remark\" href=\"iostock_remark\">[备注]</a><br></p></td></tr></tbody></table><font size=\"1.5mm\"><p style=\"line-height:0px;\">1、家用机配三条连接管一个水龙头，管件超出2.5米另行收费</p><p style=\"line-height:5px;\">2、全屋中央净水器安北京城适用水压须大于0.25MPa以上，水压偏小或偏大需付费安装增压泵或减压阀；<br></p><p style=\"line-height:0.5mm;\">3、净水器超滤膜滤芯市政供水免费保修参年，非市政供水保修壹年；树脂、PP棉、活性碳、KDF属易耗品，安装正常使用后不保修<br></p><p style=\"line-height:5px;\">4、滤芯更换服务超出主城区区域的需加收远程服务费，即单程车费乘以参；<br></p><p style=\"line-height:5px;\">5、超滤膜滤芯质保期内移机产生的配件费用，按实收取。二次移机将额外收取人工服务费（厨房型100元/次，全屋型300元/次）。<br></p><p style=\"line-height:0px;\"><br></p><p style=\"line-height:0px;\">制单：<a class=\"printVar\" data-field=\"order_operator\" href=\"order_operator\" style=\"background-color: rgb(255, 255, 255);\">{制单人}</a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;销售：<a class=\"printVar\" data-field=\"order_saleman\" href=\"order_saleman\">{销售员}</a>&nbsp; &nbsp; &nbsp; &nbsp; 安装工程师：<a class=\"printVar\" data-field=\"order_engineer\" href=\"order_engineer\">{安装工程师}</a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 客户签字：</p><p>白-存单;红-客户;黄-提货&nbsp; &nbsp; &nbsp; 公司地址：<a class=\"printVar\" data-field=\"company_address\" href=\"company_address\">{公司地址}</a>&nbsp; 服务电话：<a class=\"printVar\" data-field=\"company_tel\" href=\"company_tel\">{服务电话}</a></p></font>',1627635716,1630145774),(4,'WXD','维修单','<font size=\"4mm\"></font><p style=\"line-height:8px;\"><font size=\"4mm\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<u><a class=\"printVar\" data-field=\"company_name\" href=\"company_name\">{公司名称}</a>销 售 服 务 单</u>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </font><font size=\"2mm\">单号：</font><a class=\"printVar\" data-field=\"repair_code\" href=\"repair_code\">{单号}</a></p><font size=\"1.9mm\"><p style=\"line-height:0px;\">客户名称：<a class=\"printVar\" data-field=\"repair_user_name\" href=\"repair_user_name\">{客户名称}</a>&nbsp; &nbsp;联系电话：<a class=\"printVar\" data-field=\"repair_tel\" href=\"repair_tel\">{联系电话}</a>&nbsp;地址：<a class=\"printVar\" data-field=\"repair_address\" href=\"repair_address\">{地址}</a>&nbsp; 日期：<a class=\"printVar\" data-field=\"repair_date\" href=\"repair_date\">{日期}</a>&nbsp; &nbsp;预约时间：<a class=\"printVar\" data-field=\"repair_service_date\" href=\"repair_service_date\">{预约时间}</a>&nbsp;主机编号：<a class=\"printVar\" data-field=\"repair_product_code\" href=\"repair_product_code\">{主机编号}</a></p></font><table data-type=\"table\" class=\"table table-bordered\"><tbody><tr><td>项目</td><td>单位</td><td>数量</td><td>单价</td><td>金额</td><td>备注</td></tr><tr><td><p>服务费</p></td><td>项</td><td>1</td><td><p><a class=\"printVar\" data-field=\"repair_amount\" href=\"repair_amount\">{服务费}</a><br></p></td><td><p><a class=\"printVar\" data-field=\"repair_amount\" href=\"repair_amount\">{服务费}</a><br></p></td><td><p><a class=\"printVar\" data-field=\"repair_remark\" href=\"repair_remark\">{备注}</a><br></p></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td></tr></tbody></table><font size=\"1.5mm\"><p style=\"line-height:0px;\">1、家用机配三条连接管一个水龙头，管件超出2.5米另行收费</p><p style=\"line-height:5px;\">2、全屋中央净水器安北京城适用水压须大于0.25MPa以上，水压偏小或偏大需付费安装增压泵或减压阀；<br></p><p style=\"line-height:0.5mm;\">3、净水器超滤膜滤芯市政供水免费保修参年，非市政供水保修壹年；树脂、PP棉、活性碳、KDF属易耗品，安装正常使用后不保修<br></p><p style=\"line-height:5px;\">4、滤芯更换服务超出主城区区域的需加收远程服务费，即单程车费乘以参；<br></p><p style=\"line-height:5px;\">5、超滤膜滤芯质保期内移机产生的配件费用，按实收取。二次移机将额外收取人工服务费（厨房型100元/次，全屋型300元/次）。<br></p><p style=\"line-height:0px;\"><br></p><p style=\"line-height:0px;\">制单：<a class=\"printVar\" data-field=\"repair_operator\" href=\"repair_operator\">{制单人}</a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;派单：<a class=\"printVar\" data-field=\"repair_dispatcher\" href=\"repair_dispatcher\">{派单人}</a>&nbsp; &nbsp; &nbsp; &nbsp; 安装工程师：<a class=\"printVar\" data-field=\"repair_engineer\" href=\"repair_engineer\">{安装工程师}</a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 客户签字：</p><p>白-存单;红-客户;黄-提货&nbsp; &nbsp; &nbsp; 公司地址：<a class=\"printVar\" data-field=\"company_address\" href=\"company_address\">{公司地址}</a>&nbsp; 服务电话：<a class=\"printVar\" data-field=\"company_tel\" href=\"company_tel\">{服务电话}</a></p></font>',1628476208,1628484281);
